        productName: DataTypes.STRING,
        cost: DataTypes.INTEGER,
        sale: DataTypes.INTEGER,
        image: DataTypes.STRING,
        quantity: DataTypes.INTEGER,
        description: DataTypes.STRING,
        supplierId: DataTypes.INTEGER,



    }, {
        sequelize,
        modelName: 'Product',
    });
    return Product;
};

